using craxx_plus;
using craxx_plus.Action_;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Net;
using System.Text;
using System.Threading.Tasks;

namespace craxx
{
    public static class actionData
    {
        private static string dataURL;

        private static bool isLoaded=false;
        private static ACTION_ITEM[] decryptedData;
        public static List<actionItem> getActionItemCollection()
        {
            List<actionItem> ret = new List<actionItem>();
            
            if (isLoaded == false)
            {
                decryptedData = getCryptedData();
                isLoaded = true;
            }
            
            foreach (var data in decryptedData)
            {
                if (data._adminAction == false)
                {
                    actionItem item = new actionItem() { name = data.name, actioncode = data.actioncode };
                    ret.Add(item);
                }
                else if (data._adminAction && MainWindow._isAdmin)
                {
                    actionItem item = new actionItem() { name = data.name, actioncode = data.actioncode };
                    ret.Add(item);
                }
                
            }
            
            return ret;
        }

       private static ACTION_ITEM[] getCryptedData()
        {
            try
            {
                var data = cryptedArray;


                data = craxx_plus.Util.Decypter.Decrypt(data);


                System.Xml.Serialization.XmlSerializer serializer =
                    new System.Xml.Serialization.XmlSerializer(typeof(ACTION_ITEM[]));

                System.IO.StringReader sr = new System.IO.StringReader(data);

                ACTION_ITEM[] obj = (ACTION_ITEM[])serializer.Deserialize(sr);

                sr.Close();

                return obj;
            }
            catch
            {
                throw new Exception("ERROR ACTION LOAD");
            }
        }

        

        public static List<actionItem> getFilterActionItemCollection(string filterText)
        {
            List<actionItem> ret = new List<actionItem>();
            var data = getActionItemCollection();
            foreach (var item in data)
            {
                if (item.name.Contains(filterText) | item.actioncode.Contains(filterText))
                {
                    ret.Add(item);
                }
            }
            return ret;
        }

        private static string cryptedArray = "";
    }
}